I don’t like pictures of myself or posting millions of videos of me and I don’t want the attention because well I just don’t like it. God is the only reason I’m here and He deserves all the praise.

What I do know is that hiding what I do doesn’t inspire other women like me to fight for their dreams.

This is what 19 years of blood sweat and tears brings... Trust with large corporate clients who allow you to design their 20,000 SF space down to the last detail. Even when it means you build plant elements for their walls and ceilings yourself. 

I am the first college graduate in my immediate family. The first female CEO on both sides of my family and proud of where I am. 

You can’t cheat your way through life and try to skip the work. I see so many try to reach their dreams and get disappointed when they don’t. You just simply can’t skip the steps.

You have to get an education and a job that will teach you the skills you need. Don’t rush the teaching process... you will rob yourself of your future is you rush through your present. 

