-
Création rose, mousse, boule de mousse, lycopodiums et achilées stabilisés.

Vous vous êtes souvent demandés comment profiter de la nature alors que vous étiez constamment occupés par le travail ou autres tâches ?

Vous adorez les plantes mais n'avez pas la main verte ?
Deux artisans passionnés par la mousse végétale et autres plantes épyphytes et bryophiles vous proposent deux gammes de produits réunis par un seul et même point commun : la nature et son effet relaxant.

Depuis de nombreuses années, les japonais sont les maîtres en matière d'horticulture relaxante. La mousse, dont ils raffolent notamment pour l'art du bonsaï ou du kokedama, est partout dans leur jardin et fait partie des plantes des plus apaisantes.

Les terrariums Neverending
Ces terrariums principalement ouverts vous présentera des paysages qui auront la particularité d'être à l'épreuve du temps (durée de vie : 5 - 10 ans). Composés de végétation stabilisées, votre paysage pourra se placer même dans des pièces dans lesquelles la lumière est absente. Ne nécessitant aucun arrosage, votre petit jardin sera toujours en bonne santé et sera là où vous le désirez lorsque vous souhaiterez vous détendre.

Instructions
Vous pourrez placer votre terrarium où bon vous semble à l'exception des pièces humides comme les salles de bain, hamam ou autre pièce du même genre. Ne les exposez également pas aux rayons directs du soleil.
Leur durée de vie est de 5 à 10 ans.

Toutes les créations sont uniques. imaginées et confectionnées à la main en Suisse par deux créateurs indépendants soucieux de l’environnement.

